$(function(){
      $("#typed").typed({
			strings: [
			  "unstoppable!",
			  "branding agency",
			  "cuter in person.",
			  "Brownie",			  
			  "born to co-create reality!",
			  "hungry.",			  
			  "what we do."
		  ],
            loop: true,
            shuffle: true,
            typeSpeed: 60,
            backSpeed: 30,
            startDelay: 2000,
            backDelay: 4000,
            cursorChar: "|",          
      });
	  
	  $("#typed-personal").typed({
			strings: [
			  "web designing",
			  "system engineering",
			  "play piano",
			  "photographer",			  
			  "mobile development",
			  "wordpress"
			],
            loop: true,
            shuffle: true,
            typeSpeed: 10,
            backSpeed: 10,
            startDelay: 2000,
            backDelay: 4000,
            cursorChar: "|",          
      });
  });
  
